class Solution:
	# @param board, a 2D array
	# Capture all regions by modifying the input board in-place.
	# Do not return any value.
	def solve(self, board):
		visited = set()
		for i in range(len(board)):
			for j in range(len(board[0])):
				if board[i][j] == "O":
					self.search(board, -1, i, j, visited)
					visited.clear()
	# direction: 0 up, 1 down, 2 left, 3 right
	def search(self, board, direction, x, y, visited):
		visited.add((x,y))
		if direction != 0:
			if x + 1 == len(board):
				return False
			elif board[x+1][y] == "O" and not (x+1,y) in visited:
				self.search(board, 1, x+1, y, visited)
		if direction != 1:
			if x - 1 < 0:
				return False
			elif board[x-1][y] == "O" and not (x-1,y) in visited:
				self.search(board, 0, x-1, y, visited)
		if direction != 2: 
			if y + 1 == len(board[0]):
				return False
			elif board[x][y+1] == "O" and not (x,y+1) in visited:
				self.search(board, 3, x, y+1, visited)
		if direction != 3:
			if y - 1 < 0:
				return False
			elif board[x][y-1] == "O" and not (x,y-1) in visited:
				self.search(board, 2, x, y-1, visited)
		tmp = list(board[x])
		tmp[y] = "X"
		board[x] = "".join(tmp)
		return True

